using Interfaces.Trovit;
using Models;
using System;
using System.Linq;
using Utilities.Trovit;

namespace Application.Trovit.Parser
{

    internal class TabelaOfertDetails
    {
        public OfferDetails OfferDetails { get; set; }
        public PropertyPrice PropertyPrice { get; set; }
        public PropertyAddress PropertyAddress { get; set; }
        public PropertyDetails PropertyDetails { get; set; }
    }


    internal class TabelaOfertParser : ITrovitParser<TabelaOfertDetails>
    {
        public TabelaOfertDetails Parse(string content)
        {
            // content = mock;

            var url = extract(content, "<h2 class=\"head-text\"><a href=\"", "\"");
            if (url == "")
                return null;

            var details = HTTPClient.Get($"https://tabelaofert.pl/{url}").Replace("\t", "").Replace("\n", "").Replace("\r", "");


            var total = extract(details, "Cena całości</th><td><span class='nowrap'>", " zł").Replace(" ", "");
            var perMeter = extract(details, "Cena za m²</th><td><span class='nowrap'>", "zł").Replace(" ", ""); ;
            var area = extract(details, "<th>Metraż</th><td><span class='nowrap'>", " m²").Replace(",",".").Replace(" ", ""); ;
            var rooms = extract(details, "Liczba pokoi</th><td><span class='nowrap'>", "</span>").Replace(" ", ""); ;
            var update = extract(details, "Data aktualizacji</th><td>", "</td>").Replace(" ", ""); ;
            var floor = extract(details, "Piętro</th><td><span class='nowrap'>", "</span>").Replace(" ", ""); ; ;
            var street = extract(details, "<div class=\"informacje-line informacje-adres\"><span class=\"line-value\">", "</span>");
            var postal = extract(details, "informacje-miejscowosc\"><span class=\"line-value\">", "</span>");
            var phone = extract(details, "data-telefon=\"", "\"");
            var city = postal != "" ? ToCity(postal.Split(" ")[1]) : null;
            var name = extract(extract(details, "<div class=\"oferent-nazwa\">", "</div>"), ">", "</a>");

            var entry = new TabelaOfertDetails
            {
                OfferDetails = new OfferDetails
                {
                    CreationDateTime = DateTime.Parse(update),
                    LastUpdateDateTime = DateTime.Parse(update),
                    SellerContact = new SellerContact
                    {
                        Name = name,
                        Telephone = phone,
                    },
                    Url = $"https://tabelaofert.pl/{url}",
                    IsStillValid = true,
                },
                PropertyPrice = new PropertyPrice { 
                    PricePerMeter = Convert.ToDecimal(perMeter),
                    TotalGrossPrice = Convert.ToDecimal(total),
                },
                PropertyAddress = new PropertyAddress
                {
                    DetailedAddress = postal,
                    StreetName = street,
                },
                PropertyDetails = new PropertyDetails { 
                    Area = Convert.ToDecimal(area),
                    FloorNumber = Convert.ToInt32(floor),
                    NumberOfRooms = Convert.ToInt32(rooms),
                }
            };

            if (city != null) {
                entry.PropertyAddress.City = city.Value;
            }


            return entry;
        }

        private string extract(string s, string begining, string ending)
        {
            if (s.IndexOf(begining) == -1)
                return "";

            var b = s.Substring(s.IndexOf(begining) + begining.Length);

            if (b.IndexOf(ending) == -1)
                return "";

            var e = b.Substring(0, b.IndexOf(ending));

            return e;
        }

        private PolishCity? ToCity(string city)
        {

            city = String.Concat(city.ToUpper().Replace("-", "_").Replace(",", "").Replace(" ", "_").Select(c => {
                switch (c)
                {
                    case 'ą': return 'a';
                    case 'ć': return 'c';
                    case 'ę': return 'e';
                    case 'ł': return 'l';
                    case 'ń': return 'n';
                    case 'ó': return 'o';
                    case 'ś': return 's';
                    case 'ź': return 'z';
                    case 'ż': return 'z';
                    case 'Ą': return 'A';
                    case 'Ć': return 'C';
                    case 'Ę': return 'E';
                    case 'Ł': return 'L';
                    case 'Ń': return 'N';
                    case 'Ó': return 'O';
                    case 'Ś': return 'S';
                    case 'Ź': return 'Z';
                    case 'Ż': return 'Z';
                    default: return c;
                };
            }));

            try
            {
                return (PolishCity)Enum.Parse(typeof(PolishCity), city);
            }
            catch
            {
                return null;
            }

        }

