fert.pl</a>.<br />Administratorem danych osobowych jest również oferent, którego dotyczy zapytanie.</p><p>Informujemy, iż:</p><ul><li>Podanie przez Użytkownika danych osobowych jest dobrowolne, jednakże w celu realizacji usługi niezbędne;</li><li>Dane osobowe Użytkownika są przetwarzane przez Tabelaofert.pl sp. z o.o. w celu realizacji umowy wobec oferenta na podstawie art. 6 ust. 1 pkt b) RODO;</li><li>Dane osobowe Użytkownika są przetwarzane przez oferenta w celu odpowiedzi na zapytanie na podstawie art. 6 ust. 1 pkt b) RODO;</li><li>Dane osobowe Użytkowników serwisu są przetwarzane przez Tabelaofert.pl sp. z o.o. w celu prowadzenia marketingu własnych usług oraz w celach statystycznych i analitycznych. Przetwarzanie danych osobowych w powyższych celach jest prawnie uzasadnionym interesem Administratora na podstawie art. 6 ust. 1 pkt f) RODO;</li><li>Użytkownik ma prawo dostępu do treści swoich danych oraz prawo ich sprostowania, usunięcia, ograniczenia przetwarzania, prawo do przenoszenia danych, prawo do wniesienia sprzeciwu, prawo do cofnięcia zgody w dowolnym momencie;</li><li>Dane osobowe nie będą podlegały udostępnieniu podmiotom trzecim bez wyraźnej zgody Użytkownika z zastrzeżeniem instytucji upoważnionych prawem;</li><li>Dane osobowe Użytkownika nie będą przekazywane do państwa trzeciego bez wyraźnej zgody Użytkownika;</li><li>Dane osobowe Użytkownika będą przechowywane przez Administratora od momentu ich powierzenia przez Użytkownika do momentu cofnięcia przez Użytkownika zgody, za wyjątkiem prawnie usprawiedliwionych celów Administratora;</li><li>Każdy Użytkownik ma prawo wniesienia skargi do Prezesa UODO gdy uzna, iż przetwarzanie danych osobowych dotyczących Użytkownika narusza przepisy ogólnego rozporządzenia o ochronie danych osobowych z dnia 27 kwietnia 2016 r.</li></ul><p style=\"margin-bottom: 0\">Tabelaofert.pl sp. z o.o. udostępnia oferentowi dane osobowe Użytkownika w formie elektronicznej w celu przedstawienia oferty drogą elektroniczną i telefoniczną na wysłane zapytanie Użytkownika. Za każde inne wykorzystanie danych osobowych Użytkownika niż przedstawienie oferty przez oferenta, Tabelaofert.pl sp. z o.o. nie odpowiada.</p></div></div></div><div class=\"element checkbox zgloszenie_zgoda_marketing\"><input type=\"hidden\" name=\"zgloszenie_zgoda_marketing\" value=\"0\"><input type=\"checkbox\" name=\"zgloszenie_zgoda_marketing\" id=\"zgloszenie_zgoda_marketing\" value=\"1\" class=\"checkbox regulamin\"><label for=\"zgloszenie_zgoda_marketing\" class=\"checkbox small zgoda optional\">Chcę otrzymywać informacje o promocjach i nowych ofertach <span class=\"wiecej-link\">więcej&nbsp;»</span><div class=\"wiecej-content\">Wyrażam zgodę na przetwarzanie danych osobowych przez Tabelaofert.pl sp. z o.o. z siedzibą w Warszawie w celach marketingowych oraz przesyłanie informacji handlowej za pomocą środków komunikacji elektronicznej lub telefonicznej przez i na rzecz Tabelaofert.pl sp. z o.o. Dane osobowe Klienta mogą być przetwarzane w sposób zautomatyzowany, co pozwoli na ewentualne zaproponowanie Klientowi produktów/usług najlepiej dopasowanych, jednak decyzje wiążące nie będą zautomatyzowane.</div></label><br style=\"clear: both\"></div><input type=\"hidden\" name=\"zgloszenie_formularz\" value=\"lista\" id=\"zgloszenie_formularz\"><div class=\"zgloszenie_submit\">Wyślij</div></div></form></div></div><div id=\"bottom_actions\"><div class=\"view-mode\"><a href=\"/nowe-mieszkania/gdansk?widok=mapa\" class=\"item mapa\"><span>Mapa</span></a><div class=\"grid active\"><span class=\"item\">Lista</span></div></div><ul  class=\"ng-inline-menu ng-paginator paginator-list\"><li class=\" paginator-current paginator-first\"><a href=\"/nowe-mieszkania/gdansk?szczegoly=8069115&utm_source=Trovit&utm_medium=CPC&utm_campaign=premium\" class=\" current\" data-paginator-page=\"1\">1</a></li><li class=\"\"><a href=\"/nowe-mieszkania/gdansk?szczegoly=8069115&utm_source=Trovit&utm_medium=CPC&utm_campaign=premium&page=2\" class=\"